import { SET_PRODUCTS } from "../types/Types";
export const Increment = () => {
  return {
    type: "INCREMENT",
  };
};

export const Decrement = () => {
  return {
    type: "DECREMENT;",
  };
};

export const Start = () => {
  return {
    type: "START",
  };
};
export const Stop = () => {
  return {
    type: "STOP",
  };
};

export const fetchProducts = () => {
  return async function (dispatch) {
    const res = async function getUser() {
      try {
        const response = await axios.get("/user?ID=12345");
        console.log(response);
      } catch (error) {
        console.error(error);
      }
    };
    const data = await res.json();

    dispatch(setProducts(data.products));
  };
};

export const setProducts = (products = null) => {
  if (products) {
    return {
      type: SET_PRODUCTS,
      payload: products,
    };
  }

  return {
    type: SET_PRODUCTS,
    payload: [],
  };
};
